import React from "react";
import styles from "../scss/home.module.scss";

const Home = () => {
  return (
    <div>
      <div className={styles.heroContainer} />
      <div className={styles.panelContainer}>
        <div className={styles.panelContainer}>
          <ul>
            <li>
              <div className={styles.panelItem}>About me</div>
            </li>
            <li>
              <div className={styles.panelItem}>Work</div>
            </li>
            <li>
              <div className={styles.panelItem}>Contact</div>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Home;
